using System;
using System.Collections.Generic;
using System.Linq;

namespace AdventOfCode2018.Day5
{
    class Day5
    {
        public int Part1(string input)
        {
            var units = input.ToCharArray().ToList();
            var pointer = 0;
            while (pointer < units.Count - 1)
            {
                if (Math.Abs(Convert.ToInt32(units[pointer]) - Convert.ToInt32(units[pointer + 1])) == 32)
                {
                    units.RemoveRange(pointer, 2);
                    if (pointer > 0)
                    {
                        pointer--;
                    }

                    continue;
                }

                pointer++;
            }

            return units.Count;
        }

        public int Part2(string input)
        {
            var newPolymers = new Dictionary<char, int>();
            var distinctChars = input.ToUpperInvariant().Distinct();
            foreach (var character in distinctChars)
            {
                var modifiedUnits = input.ToCharArray().ToList();
                var lowerCaseCode = Convert.ToInt32(character) + 32;
                modifiedUnits.RemoveAll(x => x.Equals(character) || Convert.ToInt32(x) == lowerCaseCode);
                newPolymers.Add(character, Part1(string.Join("", modifiedUnits)));
            }

            return newPolymers.Min(x => x.Value);
        }

        public static void Run()
        {
            var input = GetInput();
            var exampleInput = @"dabAcCaCBAcCcaDA";
            var Day5 = new Day5();
            Console.WriteLine("\n###############\n###############\nDay5\n###############\n###############\n");
            Console.WriteLine("\n###############\nPart 1\n###############\n");
            Console.WriteLine(Day5.Part1(exampleInput));
            Console.WriteLine(Day5.Part1(input));
            
            Console.WriteLine("\n###############\nPart 2\n###############\n");
            Console.WriteLine(Day5.Part2(exampleInput));
            Console.WriteLine(Day5.Part2(input));
        }

        private static string GetInput()
        {
            return @"";
        }
    }
}
